import React from 'react';
import { useSelector } from 'react-redux';
import AppLayout from '../components/AppLayout';
const Home = () => {
	return (
		<AppLayout>
			<PostForm></PostForm>
			<PostCard></PostCard>
		</AppLayout>
	);
};
// AppLayout 안에 있는 것이 children이 되는 것.
export default Home;
